script: |
  super -f text -I q8912.spq | sort > q8912.out

inputs:
  - name: q8912.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + col1 + ( - col0 ) + - col1 NOT IN ( - - 61 * col0 + + - col0, ( - - col0 ) * 10 * - - col2, 72 );
  - name: tab1

outputs:
  - name: q8912.out
    data: |
      51	14	96
      85	5	59
      91	47	68
